window.bookSummaryJSON = "<p><b>The prince would choose to save his realm. But the beast would follow his heart… To me.</b></p> <p>After I saved his life and kingdom, Kalyll let me go, choosing duty over the passion that burned between us.</p> <p>Though his death was written in the stars, I found a dark, impossible way to pull him back, to anchor his soul to the world of the living. Still, that wasn't enough to win his heart.</p> <p>Now, the force that lives within him gives way to his darker nature, and for a second time, I'm kidnapped and made prisoner—this time in a high tower in the Seelie capital of Elyndell.</p> <p>With good and evil fighting within him, both his kingdom and heart stand at risk. He can't have it all, and his attempts to do so may be the end of all he and I hold dear.</p> <p><i>This </i>Beauty and the Beast <i>retelling features a troubled prince, a strong heroine, and an amazing supporting cast. This is an enemies-to-lovers series suitable for mature listeners that grows spicier with every book.</i></p>"; 
